	<style>
.cucumber-react .cucumber-status--passed {
  color: #2CB14A;
}
.cucumber-react .cucumber-status--skipped {
  color: #00A0CC;
}
.cucumber-react .cucumber-status--pending {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--undefined {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--ambiguous {
  color: #F4EBFD;
}
.cucumber-react .cucumber-status--failed {
  color: #BB0000;
}
.cucumber-react .cucumber-status--unknown {
  color: #B6BECB;
}
.cucumber-react h1, .cucumber-react h2, .cucumber-react h3 {
  padding: 0;
  margin: 0;
}
.cucumber-react a {
  color: inherit;
}
.cucumber-react .gherkin-document-list {
  font: 14px "Open Sans", sans-serif;
  color: #161C24;
  background: #fff;
  overflow-x: hidden;
}
.cucumber-react .cucumber-title {
  margin-top: 0.3em;
  margin-bottom: 0;
  display: inline-block;
}
.cucumber-react .cucumber-title__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-title__text {
  font-weight: normal;
}
.cucumber-react .cucumber-tags {
  padding: 0;
  margin-bottom: 0;
}
.cucumber-react .cucumber-tags .cucumber-tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react .cucumber-feature__icon {
  padding-top: 0.35em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-description,
.cucumber-react .cucumber-children {
  margin-left: 1em;
}
.cucumber-react .cucumber-feature,
.cucumber-react .cucumber-rule,
.cucumber-react .cucumber-scenario,
.cucumber-react .cucumber-background {
  margin-bottom: 1em;
}
.cucumber-react .cucumber-steps {
  list-style-type: none;
  padding-left: 10px;
}
.cucumber-react .cucumber-steps .cucumber-step {
  display: flex;
}
.cucumber-react .cucumber-steps .cucumber-step__status {
  padding-top: 0.2em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-steps .cucumber-step__content {
  flex-grow: 1;
}
.cucumber-react .cucumber-steps .cucumber-step__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-steps .cucumber-step__text {
  font-weight: normal;
}
.cucumber-react .cucumber-steps .cucumber-step__param {
  font-weight: normal;
  font-style: italic;
}
.cucumber-react .cucumber-table {
  border-collapse: collapse;
  margin-top: 0.5em;
  margin-bottom: 0.5em;
}
.cucumber-react .cucumber-table__header-cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell__status {
  padding: 0.5em 3px 3px 3px;
}
.cucumber-react .cucumber-table__cell__step {
  flex-grow: 1;
}
.cucumber-react .cucumber-code {
  padding: 0.25em;
  background-color: #ebebeb;
}
.cucumber-react .cucumber-error {
  padding: 0.5em;
  margin: 0;
  overflow: scroll;
}
.cucumber-react .cucumber-no-documents {
  font: 14px "Open Sans", sans-serif;
}
.cucumber-react .cucumber-attachment {
  background-color: #ebebeb;
  padding: 0.5em;
}
.cucumber-react .cucumber-attachment__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-attachment__image {
  margin-top: 1em;
}
.cucumber-react .cucumber-anchor {
  position: relative;
  display: flex;
  align-items: center;
  margin-top: 0.3em;
}
.cucumber-react .cucumber-anchor__link {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.cucumber-react .cucumber-anchor > * {
  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

   | password |\r\n      | test_PQIS Editorial           | 1234     |\r\n      | test_PQIS Content Corrections | 1234     |\r\n      | test_GIS Editorial            | 1234     |\r\n      | test_DISS Editorial           | 1234     |\r\n      | test_books_editorial          | 1234     |\r\n\r\n  @test @regression @smoke\r\n  Scenario: Verify and validate facets in the left panel\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user search for the \"water\" in search field\r\n    And user clicks on search button\r\n    Then user verifies left panel facets\r\n      | Disciplines | Products | Abstract | Full Text | Publication Source Type | Document Type | Document Section | Term Count | PQ One Business | Providers | Publishers | Database Type | Document Status | MR3 Fields | Active Restrictions | Publication Subjects | Content Tier | Bundle Codes|\r\n\r\n\r\n\r\n  @test1 @regression @smoke @C766484\r\n  Scenario: Verify fields and options in searched result details\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user search for the \"water\" in search field\r\n    And user clicks on search button\r\n    Then user verifies left panel facets\r\n      | Disciplines | Products | Abstract | Full Text | Publication Source Type | Document Type | Document Section | Term Count | PQ One Business | Providers | Publishers | Database Type | Document Status | MR3 Fields | Active Restrictions | Publication Subjects | Content Tier | Bundle Codes|\r\n    When user clicks on one of the results from the list of results\r\n    Then user verify the document page\r\n\r\n\r\n\r\n    @test123 @regression @C766477\r\n  Scenario: Verify reporting dropdown\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user clicks on reporting dropdown\r\n    Then user should be able to see all the reporting options\r\n\r\n   @regression @C766479\r\n  Scenario: Verify and validate batch queues option\r\n     When user enters username and password for login\r\n     And user clicks on login button\r\n     When user clicks on batch queue option\r\n     Then user should be able to see batch queue options on page\r\n\r\n  @regression @C766480\r\n  Scenario: Verify and validate batch queues option\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    When user clicks on batch queue option\r\n    Then user should be able to see batch queue options on page\r\n    Then user verify process details options on batch queue page\r\n\r\n\r\n\r\n  @regression @C766481\r\n  Scenario: Verify and validate reporting dropdown option\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    When user clicks on reporting dropdown\r\n    Then user should be able to see all the reporting options\r\n    When user clicks on provisional reports option\r\n    And user selects date from calendar\r\n    And user clicks on download option\r\n    Then user verify error message or downloaded report\r\n\r\n\r\n  @regression @C766487\r\n  Scenario: Verify and validate reporting dropdown option\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    When user clicks on reporting dropdown\r\n    Then user should be able to see all the reporting options\r\n    When user clicks on prod status report option\r\n    Then excel report should be downloaded\r\n\r\n\r\n  @test123 @regression @C766489\r\n  Scenario: Verify settings options\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user clicks on settings option\r\n    Then user should be able to see all the options under settings\r\n\r\n  @C766555 @regression\r\n  Scenario: Validation of search arrows and its values\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user search for the \"water\" in search field\r\n    And user clicks on search button\r\n    When user clicks on arrow icon\r\n    Then user should be able to see new values in the results\r\n\r\n\r\n\r\n  @C766556 @regression\r\n  Scenario: Validation of search arrows and its values\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user search for the \"water\" in search field\r\n    And user clicks on search button\r\n    When user clicks on double arrow icon\r\n    Then user should be able to see new values in the results\r\n\r\n  @C766557 @regression\r\n  Scenario: Validation of search arrows and its values\r\n    When user enters username and password for login\r\n    And user clicks on login button\r\n    Then user navigated to homepage\r\n    When user search for the \"water\" in search field\r\n    And user clicks on search button\r\n    When user clicks on left sided double arrow icon after clicking on right sided double arrow icon\r\n    Then user should be able to see new values in the results\r\n\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/U6065476/IdeaProjects/ECMS_Automation/src/test/resources/features/SearchItem.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Search item in the search bar","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@test","id":"9f576cc5-e04e-4cd2-be3d-453e9f544a01"},{"location":{"line":3,"column":9},"name":"@regression","id":"b31b1969-a733-48e1-9c8d-305f051a190c"}],"keyword":"Scenario","name":"Verify and validate search item","steps":[{"location":{"lin
